\u003cstrong\u003eDiadora Footwear\u0026nbsp;\u003c/strong\u003efrom Chain Reaction Cycles, the World\\'s Largest Online Bike Store.\u003c/p\u003e\\r\\n\u003c/p\u003e\\r\\n\u003c/p\u003e\\r\\n\u003c/p\u003e',1350,336,'2015-12-05 21:19:19','2014-07-04 19:56:10',2),(2,1,0,'NUEVA SAGA - CUADRO CARBONO UNIDIRECCIONAL - FULL XTR - RUEDAS DT',1120,32400,'2015-12-05 21:19:19','2014-07-04 20:00:09',3),(3,1,0,'NUEVA ZENITH ASTRA 2014!!!',1452,35000,'2016-04-09 19:32:36','2014-07-04 20:33:06',5),(4,1,1,'PRUEBAS',1230,50400,'2015-12-05 21:19:19','2014-07-04 20:46:44',6),(5,1,2,'PRUEBAS',1230,46260,'2015-12-05 21:19:19','2014-07-04 20:48:00',7),(6,1,0,'PISTA',1550,19990,'2015-03-07 23:01:23','2014-07-07 20:24:59',13),(7,1,1,'SDE',985,15000,'2015-03-07 22:55:03','2014-07-07 20:26:23',14),(8,1,2,'PRUEB',1220,1811,'2015-12-05 21:19:19','2014-07-10 19:00:49',16),(9,1,2,'NUEVO XT',150,2000,'2016-01-01 21:49:27','2014-07-28 20:42:18',17),(10,1,2,'ADAPTADOR ALARGUE PARA VALVULA AUTO\\r\\nPeso: 10.00 gramos\\r\\nC鲁digo art颅culo: 4205',1,33,'2015-07-04 21:39:34','2014-07-28 21:31:56',18),(11,1,4,'ADAPTADOR P/INSTALAR MANIJAS DE CAMBIO AL CUADRO (5 PIEZAS) - P/BICI RUTA\\r\\n\\r\\nPeso: 33.00 gramos\\r\\nC鲁digo art颅culo: 1199',1,84,'2016-04-09 21:10:27','2014-07-28 21:33:02',19),(12,1,1,'\\r\\n                Rediscover control. Rediscover efficiency. Discover Di2.\u003cbr\u003e\\r\\n\u003cbr\u003e\\r\\nShimano\\'s XTR M9050 Di2 shifting system brings the seamless control and \\r\\ninstant response that only digital shifting can provide to the M9000 \\r\\nRhythm Step drivetrain. This ushers in the digital age for mountain \\r\\nbikers, giving them control over their ride experience, no matter their \\r\\ndiscipline, like never before.\u003cbr\u003e\\r\\n\u003cbr\u003e\\r\\nPairing Di2 with close gear steps means that shifting becomes a reflex. Decreased shift\u003cbr\u003e\\r\\n\\r\\n            \\r\\n            \\r\\n                effort and superior ergonomics allow you to shift \\r